import React from 'react';
import './styles.css'

import logoImg from '../../assets/logo.svg'

function Register() {
  return (
    <div className='register-container'>
      <div className="content">
        <section>
          <img src={logoImg} alt="BeTheHero" />

          <h1>Cadastro</h1>
        </section>
      </div>
    </div>
  )
}

export default Register;
